import React, { Component } from 'react';

class Message extends Component{

    constructor(){
        super()
        this.state={
            message:'hello judy'
        }
    }

    changeMessage(){
        this.setState({
            message:'thank you'
        })
    }
    render(){
        return (
            <div>
                <h1>{this.state.message}</h1>
                <button onClick={()=>this.changeMessage()}>ok</button>
            </div>

        )
    }
}

export default Message;
